/**
 * Get all static endpoints
 */
export function getStaticEndpoints(): DiscoveredEndpoint[] {
  return staticEndpoints;
}

/**
 * Get endpoint by ID
 */
export function getStaticEndpointById(id: string): DiscoveredEndpoint | undefined {
  return staticEndpoints.find((e) => e.id === id);
}

/**
 * Get endpoint by tool name
 */
export function getStaticEndpointByToolName(toolName: string): DiscoveredEndpoint | undefined {
  return staticEndpoints.find((e) => e.toolName === toolName);
}
